    <li>The client responds with a ClientKeyExchange message, which may contain a PreMasterSecret, public key, or nothing. (Again, this depends on the selected cipher.) This PreMasterSecret is encrypted using the public key of the server certificate.</li>
    <li>The client and server then use the random numbers and PreMasterSecret to compute a common secret, called the ""master secret"". All other key data for this connection is derived from this master secret (and the client- and server-generated random values), which is passed through a carefully designed pseudorandom function.</li>
    <li>The client now sends a ChangeCipherSpec record, essentially telling the server, ""Everything I tell you from now on will be authenticated (and encrypted if encryption parameters were present in the server certificate)."" The ChangeCipherSpec is itself a record-level protocol with content type of 20.</li>
    <br/>
    Finally, the client sends an authenticated and ");
            WriteLiteral(@"encrypted Finished message, containing a hash and MAC over the previous handshake messages.
    The server will attempt to decrypt the client's Finished message and verify the hash and MAC. If the decryption or verification fails, the handshake is considered to have failed and the connection should be torn down.
</ul>

